Приложение позволяет контролировать автомобиль с установленной телематической системой StartFone 2 и StartFone 3.



Возможности управления:

    • Дистанционный запуск и глушение двигателя на любом расстоянии;
    • Управление дополнительным подогревателем;
    • Поиск автомобиля на стоянке;
    • Дистанционное открытие багажника;
    • Дистанционная постановка и снятие с охраны;
    • Управление видеорегистратором;
    • Возможность дистанционно включить и выключить блокировку двигателя;
    • Включение и выключение сервисного режима для ТО.


Понятный контроль состояний всех параметров:

    • Баланс СИМ-карты;
    • Топливо;
    • Напряжение аккумулятора;
    • Скорость;
    • Температура внутри салона и внешнего датчика;
    • Контроль состояния периметра и всех режимов системы.




Возможности приложения:

    • Одна учётная запись поддерживает несколько автомобилей;
    • Возможность переназначать и двигать кнопки на главном экране;
    • Приложение оптимизировано под управление правой или левой рукой;
    • Настройка основных параметров системы;
    • Автозапуск по напряжению, температуре и времени;
    • Календарь автозапуска;
    • Отображение местоположения автомобиля на карте;
    • Трекинг с точным указанием времени, координат и скорости движения в каждой точке. Отображение суточного пробега, максимальной и средней скорости;
    • История событий по датам с указанием времени.



- Для определения местоположения и трекинга требуется GPS/Глонасс приёмник.
- Отображение данных и управление зависит от типа автомобиля и подключений.
